var tipuesearch = {"pages": [{'title': '40823121', 'text': '\n', 'tags': '', 'url': '40823121.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Midterm', 'text': '', 'tags': '', 'url': 'Midterm.html'}, {'title': 'w1', 'text': '\n', 'tags': '', 'url': 'w1.html'}, {'title': 'w2~w4', 'text': '\n \n \n \n \n \n \n \n', 'tags': '', 'url': 'w2~w4.html'}, {'title': 'W5', 'text': '什麼是API? \n API 是 應用程式介面\xa0\xa0 \n 可以幫助開發者節省精力，並很快的達到目的。舉個例子，假日出去玩總是玩到很累，肚子餓，讓人很想去飲料販賣機買麵包來吃。現在你面前有一台飲料販賣機，接下來你會這麼做： \n \n 你想吃麵包 \n 你按了販賣機上的麵包按鈕 \n 你從取物口拿出麵包\xa0 \n \n API 的概念-剛剛例子中的麵包就是「你想取得的資料」。而販賣機上的按鈕就是 API ，按下去販賣機就收到了你的需求，並將麵包從取物口送出，你也就得到了你想要的資料了。 \n \n', 'tags': '', 'url': 'W5.html'}, {'title': 'W6', 'text': '如何使用API控制Solidworks與Inevntor繪製模型, 並同時將各模型之體積與圖片匯入.html檔, 使其能在網頁中瀏覽各模型之變化 \n', 'tags': '', 'url': 'W6.html'}, {'title': 'W7', 'text': '', 'tags': '', 'url': 'W7.html'}, {'title': '工程師', 'text': '1.creat具有創造性 工程職業人員 需擁有條件 \xa0發明 設計 分析 構建\xa0  且經過  反覆測試 2.聰明精巧且正確的配置 數學英文很重要 (用於工程師之間溝通) mathematics數學分析能力 scientific principles 科學原理分析能力 \n', 'tags': '', 'url': '工程師.html'}, {'title': 'scite 編輯器', 'text': '\n 下載 cad2020_w7_tcc_gnuplot.7z解壓縮到隨身碟資料夾裡 \n \n 將start.bat丟入小白框修改(新增)框內之路徑 \n \n 使用下載的cad2020_w7_tcc_gnuplot.7z裡的wscite資料夾將cpp.properties批次檔案複製出 \n \n \n 將下載的cpp.properties覆蓋至cad2020資料夾內部原有的cpp.properties批次檔 \n \n \n 即可執行以下程式 \n \n \n \n \n \n', 'tags': '', 'url': 'scite 編輯器.html'}, {'title': 'w8', 'text': '下載\xa0 Pyslvs_UI \n Pyslvs 使用手冊 \n Pyslvs連桿機構運用 \n \n \n', 'tags': '', 'url': 'w8.html'}, {'title': 'w9', 'text': '期中考週 \n \n', 'tags': '', 'url': 'w9.html'}, {'title': 'Final', 'text': '', 'tags': '', 'url': 'Final.html'}, {'title': 'w10', 'text': '下載 coppeliasim , 以組為單位設計出一組機構, 可由inventor繪製完機構圖, 再放到coppeliasim進行模擬 \n \n vcruntime140_1.zip 解壓縮完丟進 CoppeliaSimEdu_4.1.0_rev \n \n \n 小組討論 \n', 'tags': '', 'url': 'w10.html'}, {'title': 'w11', 'text': '討論要設計的機構，並匯入coppeliasim測試及修改。 \n', 'tags': '', 'url': 'w11.html'}, {'title': 'w12', 'text': 'Coppeliasim使用者說明，及放置程式內模擬。 \n 1.利用Solidworks,Inventor,等各3D繪圖軟體繪製機構圖,並將檔案存成STL檔並匯入Coppeliasim中,所有檔案以英文檔名。 \n 2.繪製機構時以coppeliasim中的軸向為基準,Z軸向上避免匯入時還需要調軸向。 \n 3.使用Edit->Grouping/Merging->Divide selected shapes 將匯入的STL檔案做零件分割。 \n 4.使用Add->joint->Revolute讓物件做旋轉。 \n 5.必須開啟動態屬性對話框中的選項才能使物件做旋轉或移動或讓物件之間作接觸。 \n', 'tags': '', 'url': 'w12.html'}, {'title': 'w13', 'text': '持續討論機構 \n', 'tags': '', 'url': 'w13.html'}, {'title': 'w14', 'text': '學習coppeliasim基本用法,匯入檔案,軸向控制,位置移動,軸關節的放置與使用 \n \n \n', 'tags': '', 'url': 'w14.html'}, {'title': 'w15', 'text': '各組開會討論機構 \n', 'tags': '', 'url': 'w15.html'}, {'title': 'w16', 'text': '到課自評並抽查同學網頁，各組持續討論製作並分工。 \n', 'tags': '', 'url': 'w16.html'}]};